('2331','18','7869','Mari Caballero',Null,'Einfamilienhaus auf Doppelgrundstück in Nova Santa Ponsa zu verkaufen','32893','Nova Santa Ponsa ist eine sehr beliebte und ruhige Wohnlage. Im näheren Umfeld befinden sich mehrere Golfplätze, Jachthäfen, Restaurants, Supermärkte u.v.m.\r\nDas Haus, im mallorquinischen Stil, wurde im Jahr 2000 erstellt und steht auf einem 2000m² großen Doppelgrundstück. Ein GS wurde als Garten angelegt, könnte aber noch mit einem Einfamilienhaus bebaut werden.  Die ca 270m² Wohnfläche (plus Untergeschoss von ca 230m²) bieten 4 Schlafzimmer, 3 Bäder, Wohn-Esszimmer, Küche und diverse Abstellräume. Zur Ausstattung gehören u.a. Alu Doppelglasfenster, Klimaanlage w/k, sowie ein Pool\r\n','32894','1300000','106','2015-04-30 14:55:06','106','2015-04-30 14:55:54',Null,'2390','121','1124',1,'1','0',Null,Null,Null,'32895',Null,'0','0','0',Null,'2015-04-30 15:02:48',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'32896',Null,'32897',Null,'32898',Null,'32899','971799614','32900','0',0,'7');
